import React from 'react';
import './App.css';
import Navbar from './Component/Layout/Navbar';
import {BrowserRouter, Route} from 'react-router-dom'
import Home from './Component/Pages/Home';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Route path="/">
          <Home/>
        </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
